// src/components/UserList.tsx
import React from 'react';
import { User } from '../models/User';
import { List, ListItem, ListItemText, IconButton, ListItemSecondaryAction } from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';

// Interfaz de las propiedades de UserList
interface UserListProps {
  users: User[];
  onDelete: (userId: string) => void;
  onEdit: (user: User) => void; // Nueva propiedad para editar
}

const UserList: React.FC<UserListProps> = ({ users, onDelete, onEdit }) => {
  return (
    <List>
      {users.map((user) => (
        <ListItem key={user._id} button>
          <ListItemText primary={user.username} secondary={user.email} />
          <ListItemSecondaryAction>
            <IconButton edge="end" aria-label="edit" onClick={() => onEdit(user)}>
              <EditIcon />
            </IconButton>
            <IconButton edge="end" aria-label="delete" onClick={() => onDelete(user._id)}>
              <DeleteIcon />
            </IconButton>
          </ListItemSecondaryAction>
        </ListItem>
      ))}
    </List>
  );
};

export default UserList;
